import React from "react";
import Router from "./router";

interface Identities<V, M> {
  value: V,
  message: M
}

function App() {
  function identity<T, U>(value: T, message: U):Identities<T,U> {
    let data: Identities<T, U> = {
      value,
      message
    }
    return data;
  }
  return (
    <div className="App">
      <Router></Router>
    </div>
  );
}

export default App;
